from z3 import *
s = Solver()

#Declaring parameter variables

N = Int('N')
T = Int('T')
F = Int('F')
NplusTdiv2 = Int('NplusTdiv2')
s.add(N >= 0)
s.add(T >= 0)
s.add(F >= 0)
s.add(NplusTdiv2 >= 0)

#Adding the resilience condition

s.add(Or((2 * NplusTdiv2) == (N + T),(2 * NplusTdiv2) == ((N + T) - 1)))
